import React from "react";
import { Link } from "react-router-dom";
import "./ForgottenPassword.css";
import "./LoginPage.css";

const ForgottenPassword = () => {
    return (
        <div className="login-page-background">
            <div className="forgotten-password">
                <form className="forgotten-password-form-wrap">
                    <p className="forgotten-password-form-header">
                        Find your account
                    </p>
                    <hr />
                    <p className="forgotten-password-text-desription">
                        Please enter your mobile number to change for your
                        account
                    </p>
                    <div className="forgotten-password-form-box">
                        <input type="tel" placeholder="Phone number" />
                    </div>
                    <Link to={"/registerconfirm"}>
                        <button type="submit">Change Password</button>
                    </Link>
                    <button type="cancel">Cancel</button>
                </form>
                <p1 className="text-optional">
                    <Link to={"/login"}>Already have an account?</Link>
                </p1>
                <Link to={"/login"}>
                    <button type="button">Log in</button>
                </Link>
            </div>
        </div>
    );
};

export default ForgottenPassword;
